import React, { useRef, useEffect, useState } from 'react';
import { View, Text, Image, TextInput, TouchableOpacity, Animated, Alert } from 'react-native';
import { StatusBar } from 'expo-status-bar';
import { useNavigation } from '@react-navigation/native';
import useAuth from '../hooks/auth';

export default function SignUpView() {
  const navigation = useNavigation();
  const fadeAnim = useRef(new Animated.Value(0)).current;

  const [fullName, setFullName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [userType, setUserType] = useState('buyer'); // Default to 'buyer', change as needed

  const { signUp } = useAuth();

  useEffect(() => {
    Animated.timing(fadeAnim, {
      toValue: 1,
      duration: 1000,
      useNativeDriver: true,
    }).start();
  }, [fadeAnim]);

  const handleSignUp = async () => {
    try {
      await signUp(email, password, { fullName, userType });
      Alert.alert('Success', 'Account created successfully');
      navigation.navigate('Home');
    } catch (error) {
      Alert.alert('Error', error.message);
    }
  };

  return (
    <View style={styles.container}>
      <StatusBar style="light" />
      <Image source={require('../assets/background.png')} style={styles.backgroundImage} />

      <View style={styles.lightsContainer}>
        <Animated.Image source={require('../assets/light.png')} style={styles.lightImage} />
        <Animated.Image source={require('../assets/light.png')} style={styles.lightImage} />
      </View>

      <View style={styles.formContainer}>
        <View style={styles.titleContainer}>
          <Animated.Text style={styles.titleText}>Sign Up</Animated.Text>
        </View>

        <View style={styles.inputContainer}>
          <Animated.View style={styles.inputView}>
            <TextInput
              placeholder="Full Name"
              placeholderTextColor={'gray'}
              style={styles.inputText}
              onChangeText={(text) => setFullName(text)}
            />
          </Animated.View>
          <Animated.View style={styles.inputView}>
            <TextInput
              placeholder="Email"
              placeholderTextColor={'gray'}
              style={styles.inputText}
              onChangeText={(text) => setEmail(text)}
            />
          </Animated.View>
          <Animated.View style={styles.inputView}>
            <TextInput
              placeholder="Password"
              placeholderTextColor={'gray'}
              secureTextEntry
              style={styles.inputText}
              onChangeText={(text) => setPassword(text)}
            />
          </Animated.View>

          <View style={styles.dropdownContainer}>
            <Text style={styles.dropdownLabel}>Select User Type:</Text>
            <TouchableOpacity
              style={styles.dropdownButton}
              onPress={() => {
                // Implement your custom dropdown logic here
              }}
            >
              <Text style={styles.dropdownButtonText}>{userType}</Text>
            </TouchableOpacity>
          </View>

          <Animated.View style={styles.buttonContainer}>
            <TouchableOpacity onPress={handleSignUp} style={styles.signUpButton}>
              <Text style={styles.buttonText}>Sign Up</Text>
            </TouchableOpacity>
          </Animated.View>

          <Animated.View style={styles.loginContainer}>
            <Text>Already have an account? </Text>
            <TouchableOpacity onPress={() => navigation.push('Login')}>
              <Text style={styles.loginLink}>Login</Text>
            </TouchableOpacity>
          </Animated.View>
        </View>
      </View>
    </View>
  );
}

const styles = {
  container: 
  { flex: 1, 
    backgroundColor: 'white' },
  backgroundImage: 
  { position: 'absolute', 
  height: '100%',
   width: '100%' },
  lightsContainer: 
  { flexDirection: 'row'
  , justifyContent: 'space-around', 
  position: 'absolute' },
  lightImage: 
  { height: 225, 
    width: 90, 
    opacity: fadeAnim },
  formContainer: 
  { flex: 1, 
    justifyContent: 'center', 
    marginHorizontal: 5 },
  titleContainer: 
  { alignItems: 'center' },
  titleText: 
  { color: 'white',
   fontWeight: 'bold', 
   fontSize: 30, 
   opacity: fadeAnim },
  inputContainer: 
  { marginTop: 200 },
  inputView: 
  { backgroundColor: 'rgba(0, 0, 0, 0.1)', 
  padding: 15, 
  borderRadius: 10, 
  marginBottom: 10, 
  opacity: fadeAnim },
  inputText: 
  { 
    color: 'gray' },
  dropdownContainer: 
  { 
    backgroundColor: 'rgba(0, 0, 0, 0.1)', 
    padding: 15, 
    borderRadius: 10, 
    marginBottom: 10, 
    opacity: fadeAnim },
  dropdownLabel:
  { color: 'gray', 
  marginBottom: 5 },
  dropdownButton: 
  { backgroundColor: 'white', 
  padding: 10, 
  borderRadius: 5 },
  dropdownButtonText: 
  { color: 'gray' },
  buttonContainer: 
  { backgroundColor: '#00BFFF', 
  padding: 10, 
  borderRadius: 10, 
  marginBottom: 10, 
  opacity: fadeAnim },
  signUpButton: 
  { fontSize: 18, 
    fontWeight: 'bold', 
    color: 'white', 
    textAlign: 'center' },
  loginContainer: 
  { flexDirection: 'row', 
  justifyContent: 'center', 
  opacity: fadeAnim },
  loginLink: 
  { color: '#00BFFF' },
};
